    [],nt"num_tags": 0,nt"name": "aerial-photography-and-imagery-ortho-corrected-2007-digital-orthophotos-bay-county",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is a collection of GeoTIFF
    and MrSID format natural color orthophotos covering Washington, Holmes, and Bay
    County, Florida. An orthophoto is remotely sensed image data in which displacement
    of features in the image caused by terrain relief and sensor orientation have been
    mathematically removed. Orthophotography combines the image characteristics of a
    photograph with the geometric qualities of a map. Imagery was acquired for Washington
    and Holmes Counties at 0.9 foot ground sample distance (GSD) resolution. Flight
    height maintained during mission was 8,650 feet AGL. The imagery was captured at
    12-bit radiometric resolution and converted to 8-bit radiometric resolution during
    post processing. The imagery was captured with 20% sidelap between all adjacent
    flight lines. The imagery was obtained and processed by all digital means beginning
    with data acquisition using a Leica ADS40 Digital Airborne Sensor. Bay County was
    flown using the Z/I Imaging Digital Mapping Camera (DMC). The orthophotos are available
    in GeoTIFF and MrSID form. The projected coordinate system is State Plane Florida
    North (FIPS Zone 903), NAD 83 HPGN, GRS 80, Units Feet.",nt"owner_org": "b0b4c45b-a8ca-416b-b463-ee90d0a1a3df",nt"extras":
